import './App.css';
import Homepage from './components/homepage/homepage';
import Login from './components/login/login';
import Register from './components/register/register';
import { useState, useEffect } from 'react';
import { BrowserRouter, Routes, Route, useSearchParams } from "react-router-dom";



function App() {
  const [searchParams, setSearchParams] = useSearchParams()
  const[ user, setLoginUser ] = useState({})

  useEffect(() => {
    if(searchParams.get("user")){
      console.log(searchParams.get("user"))
      setLoginUser(searchParams.get("user"))
    }
  }, []);
  // console.log()

  return (
    <div className="App">
        <Routes>
          <Route path="/" element={user && user._id?<Homepage user={user} setLoginUser={setLoginUser}/>:<Login setLoginUser={setLoginUser}/>}></Route>
          <Route path="/:id" element={user && user._id?<Homepage user={user} setLoginUser={setLoginUser}/>:<Login setLoginUser={setLoginUser}/>}></Route>
          <Route path="/login" element={<Login setLoginUser={setLoginUser}/>} />
          <Route path="/register" element={<Register />} />
        </Routes>
      {/* <Homepage /> */}
      {/* <Login /> */}
      {/* <Register /> */}
    </div>
  );
}

export default App;
